const Stopwatch = () => {
    const [time, setTime] = useState(0);
    const [state, setState] = useState('paused');

    const run = setTimeout(() => {
        console.log
    }, 5000);

    return (
        <>
            <div>{time}</div>
            <div onClick={run}>click me</div>
        </>
    );
};

export default Stopwatch;
